INSERT INTO `test` VALUES ('1', '科技部：​磷酸氯喹对新冠肺炎有疗效', '<p><strong style=\"color: rgb(51, 51, 51); font-family: PingFangSC-Regular, Helvetica, Arial, &quot;Microsoft Yahei&quot;, sans-serif; font-size: 18px;\">央视网消息：</strong><span style=\"color: rgb(51, 51, 51); font-family: PingFangSC-Regular, Helvetica, Arial, &quot;Microsoft Yahei&quot;, sans-serif; font-size: 18px;\">在今天（17日）下午的国务院联防联控机制新闻发布会上，科技部生物中心副主任孙燕荣介绍：磷酸氯喹是抗疟药，已在临床上用了70多年。临床上我们非常确定地看到了它对新冠肺炎的疗效，且未发现和药物相关的严重不良反应。专家组一致认为该药用于广泛人群治疗的安全性是可控的。基于前期开展的临床研究结果，可以明确磷酸氯喹治疗新冠肺炎具有疗效，基于当前临床救治的迫切需求，专家一致推荐应尽快将磷酸氯喹纳入新一版的诊疗指南，扩大临床适用范围。</span>&nbsp;&nbsp;<br></p>', 'null');
INSERT INTO `test` VALUES ('2', '数百红梅傲雪绽放 姹紫嫣红报春来', '<p style=\"margin-bottom: 20px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\"><img src=\"https://himg2.huanqiucdn.cn/attachment2010/2020/0216/14/10/20200216021031379.jpg\" title=\"\" style=\"border-width: initial; border-color: initial; border-image: initial; max-width: 100%; display: block; height: auto; margin: 10px auto 20px;\"></p><p style=\"margin-bottom: 20px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">扬子晚报网2020年2月16日讯，“着红妆，裹素光，吟唱寒风放异香。”昨夜今晨（2月16日），镇江句容迎来鼠年首场降雪。雪后天气放晴，点点红梅在寒风中竞相绽放，美不胜收，为早春增添了一道别样的风景。16日早晨，记者在句容河风光带看到，一场降雪过后，数百株红梅在皑皑白雪中有的含苞待放，有的凌寒盛开。疏影横斜、暗香浮动，令人惊艳。其间，阳光透过嫣红的花瓣，将花儿映衬的更加绚丽，构成了一幅令人神往的“红梅探春图”。</p><p style=\"margin-bottom: 20px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\"><img src=\"https://himg2.huanqiucdn.cn/attachment2010/2020/0216/14/10/20200216021033114.jpg\" title=\"\" style=\"border-width: initial; border-color: initial; border-image: initial; max-width: 100%; display: block; height: auto; margin: 10px auto 20px;\"></p><p style=\"margin-bottom: 20px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">2020年2月16日早晨，记者在句容河风光带看到，一场降雪过后，数百株红梅在皑皑白雪中有的含苞待放，有的凌寒盛开。疏影横斜、暗香浮动，令人惊艳。其间，阳光透过嫣红的花瓣，将花儿映衬的更加绚丽，构成了一幅令人神往的“红梅探春图”。</p>', 'null');
INSERT INTO `test` VALUES ('3', '航拍贵州省级新冠肺炎集中救治医院将军山医院', '<p><br></p><p style=\"margin-bottom: 20px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\"><img src=\"https://himg2.huanqiucdn.cn/attachment2010/2020/0218/20200218074103955.jpg\" title=\"\" style=\"border-width: initial; border-color: initial; border-image: initial; max-width: 100%; display: block; height: auto; margin: 10px auto 20px;\"></p><p style=\"margin-bottom: 20px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">2月17日，航拍贵州省级新冠肺炎集中救治医院将军山医院。贵州省级新冠肺炎集中救治点将军山医院一期工程日前交付使用，集中收治重症和危重症确诊病例患者。按照“集中病例、集中专家、集中资源、集中治疗”的原则抓好新冠肺炎医疗救治工作，贵州1月24日将贵阳市公共卫生救治中心确定为集中救治医院，对救治中心大水沟院区原有76张床位进行改造，并新建院区，2月7日，贵州省将军山医院成立。中新社记者 瞿宏伦 摄<br></p><p style=\"margin-bottom: 20px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\"><img src=\"https://himg2.huanqiucdn.cn/attachment2010/2020/0218/20200218074103704.jpg\" title=\"\" style=\"border-width: initial; border-color: initial; border-image: initial; max-width: 100%; display: block; height: auto; margin: 10px auto 20px;\"></p><p style=\"margin-bottom: 20px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">2月17日，工作人员在医院ICU病房安装设备。医院规划面积3.2万平方米，总投资约2.7亿元，床位491张，其中改造床位76张、新建床位415个。计划分三期建设，一期床位118个，包含30个ICU床位，参照武汉市火神山医院、雷神山医院设计，以装配式集装箱为组成单元。中新社记者 瞿宏伦 摄</p>', 'null');
